sys_variable_value.value:
(function execute(inputs, outputs) {
  if (inputs.status_code == '201') {
    outputs.status = "Success";
    var response = JSON.parse(inputs.response)
    outputs.type=response['type'];
    outputs.id = response['id'];
    outputs.user=JSON.stringify(JSON.parse(inputs.response)['user']);
    outputs.group = JSON.stringify(JSON.parse(inputs.response)['group']);  
    outputs.membership_details_1 = response;
  } else {
    outputs = new BoxErrorHandler().addToGroupErrorHandler(inputs, outputs);
  }
})(inputs, outputs);

